import React from "react";
import CardVertical from "../../../components/websiteMobile/card/cardVertical/CardVertical";
import "./Body.css";

const Body = ()=>{
    let datos = [{title:"Pizza Peperoni", subtitle:"With tomato", img:"https://images.pexels.com/photos/4394612/pexels-photo-4394612.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500",price:10}, {title:"Pizza with chedar", subtitle:"With cheese", img:"https://images.pexels.com/photos/5108603/pexels-photo-5108603.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500",price:10}]
    return (
        <>
        <div className="bodyContainer">
            {
                datos.map(p => <CardVertical product={p}/>)
            }
        </div>
        <span className="bodyMore"><i class="far fa-chevron-double-down"></i>More<i class="far fa-chevron-double-down"></i></span>
        </>
    )
}
export default Body;

